-- This only exists for the purpose of re-creating test warehouse iceberg table "temperature"
-- https://figshare.com/articles/dataset/temperature_csv/3171766/1

CREATE TABLE temperatures
(
    record_id string,
    month string,
    day string,
    year string,
    average_temperature_fahr string,
    average_temperature_uncertainty_fahr string,
    city string,
    country_id string,
    country string,
    latitude string,
    longitude string
)
USING iceberg
PARTITIONED BY (country_id);

